import Head_Banner from "../components/Head_Banner";
import Layout from "../layouts/Layout";

const High_Gain = () => (
  <Layout>
    <Head_Banner
      text_1={"HIGH GAIN INVESTMENT"}
      text_2={"Get more money, but more risky."}
    />
  </Layout>
);

export default High_Gain;
